DROP TABLE IF EXISTS `t_acco_bitmap`;
CREATE TABLE `t_acco_bitmap` (
  `seq` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `ctime` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '记录创建时间',
  `mtime` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '记录修改时间',
  `vc_tag_type` varchar(50) NOT NULL COMMENT '类型',
  `vc_tag_id` varchar(50) NOT NULL COMMENT '类型id',
  `ni_cardinality` int NOT NULL DEFAULT '0' COMMENT '标签当前容量',
  `ni_version` bigint NOT NULL DEFAULT '0' COMMENT '版本号',
  `vc_byte` longtext COMMENT 'bitmap',
  PRIMARY KEY (`seq`) USING BTREE,
  UNIQUE KEY `uniq_tyep_id` (`vc_tag_type`,`vc_tag_id`) USING BTREE,
  KEY `idx_mtime` (`mtime`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8mb3 COMMENT='客户标签表';

